import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import UserLayout from './UserLayout';
import AdminLayout from './AdminLayout';
import LocationLayout from './LocationLayout';
import Home from './com/home';
import Location from './com/location';
import Hotel from './com/hotel';
import Feed from './com/feedback';
import AdminHome from './admin/home';
import AdminLogin from './admin/AdminLogin';
import Tour from './com/tours';
import SchedulerHome from './scheduler/home';
import AgentHome from './travelagent/home';
import Location_Home from './locationmanager/home';
import Newlocation from './com/newLocation';
import Schedulerlayout from './schedulerlayout';
import Travelagency from './com/agency';
import Packages from './com/packages';
import LoginPage from './com/LoginPage';
import SignUpPage from './com/SignUpPage';
import PrivateRoute from './PrivateRoute'; // Import PrivateRoute

function App() {
  return (
    <Router>
      <Routes>
        {/* Login and Signup Routes */}
        <Route path="/LoginPage" element={<LoginPage />} />
        <Route path="/signup" element={<SignUpPage />} />

        {/* Protected User Routes */}
        <PrivateRoute path="/home" element={<UserLayout><Home /></UserLayout>} />
        <PrivateRoute path="/location" element={<UserLayout><Location /></UserLayout>} />
        <PrivateRoute path="/hotel" element={<UserLayout><Hotel /></UserLayout>} />
        <PrivateRoute path="/feed" element={<UserLayout><Feed /></UserLayout>} />
        <PrivateRoute path="/tours" element={<UserLayout><Tour /></UserLayout>} />
        <PrivateRoute path="/newLocation" element={<UserLayout><Newlocation /></UserLayout>} />
        <PrivateRoute path="/agency" element={<UserLayout><Travelagency /></UserLayout>} />
        <PrivateRoute path="/packages" element={<UserLayout><Packages /></UserLayout>} />

        {/* Admin Routes */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <PrivateRoute path="/admin/home" element={<AdminLayout><AdminHome /></AdminLayout>} />

        {/* Role-based Routes */}
        <PrivateRoute path="/scheduler/home" element={<Schedulerlayout><SchedulerHome /></Schedulerlayout>} />
        <PrivateRoute path="/travelagent/home" element={<AdminLayout><AgentHome /></AdminLayout>} />
        <PrivateRoute path="/LocationAdmin/home" element={<LocationLayout><Location_Home /></LocationLayout>} />
      </Routes>
    </Router>
  );
}

export default App;
